import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const FeaturedSlider = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,

  };

  return (
    <><Slider {...settings} className="mx-auto w-2/4">
      <div className=''>
        <img src="https://gamikey.com/wp-content/uploads/2023/08/Banner-Kapersky.png.webp" alt="Slide 1" className='rounded-3xl' />
      </div>
      <div className='max-h-full'>
        <img src="https://gamikey.com/wp-content/uploads/2023/08/Banner-Discord.png.webp" alt="Slide 2" className='rounded-3xl' />
      </div>
      <div>
        <img src="https://gamikey.com/wp-content/uploads/2023/09/Adobe-Pro-Edition-Banner-1536x768.png" alt="Slide 3" className='rounded-3xl' />
      </div>
      {/* Thêm nhiều slide khác nếu cần */}

    </Slider><div>
        <img src="https://gamikey.com/wp-content/uploads/2023/09/Adobe-Pro-Edition-Banner-1536x768.png" alt="Slide 3" className='rounded-3xl' />
      </div>
      <div>
        <img src="https://gamikey.com/wp-content/uploads/2023/09/Adobe-Pro-Edition-Banner-1536x768.png" alt="Slide 3" className='rounded-3xl' />
      </div></>

  );
};

export default FeaturedSlider;
